package org.example.service.rollbackChore;import org.apache.rocketmq.spring.annotation.RocketMQMessageListener;import org.apache.rocketmq.spring.core.RocketMQListener;import org.example.commonModels.AgentChore;import org.example.grpc.AgentChoreGrpcServer;import org.springframework.stereotype.Service;@RocketMQMessageListener(topic = "AgentRollbackTopic", consumerGroup = "agentService-consumer-group")@Servicepublic class AgentRollback implements RocketMQListener<AgentChore> {    private AgentChoreGrpcServer agentService;    public AgentRollback(AgentChoreGrpcServer agentService) {        this.agentService = agentService;    }    @Override    public void onMessage(AgentChore userChore) {        agentService.rollbackAgent(userChore.getRollbackId());    }}